return `<span style="${style}">\${entityName}</span>`;

settings.tooltipFunction:
let temp, humidity;

temp = dsData[dsIndex]['temp'];
if(temp === null) {
    temp = "not set";
} else {
    temp = temp + '°C';
}

humidity = dsData[dsIndex]['humidity'];
if(humidity === null) {
    humidity = "not set";
} else {
    humidity = humidity + '%';
}


return `<b>\${entityLabel}</b><br /><br /><b>Avarage humidity:</b> ${humidity}<br/><b>Average temperature:</b> ${temp}<br/><small>See advanced settings for details</small>`;

